import React from 'react';
import axios from 'axios';

function InjectionList({ injections, onDelete }) {
  async function handleDelete(id) {
    await axios.delete(`/api/injections/${id}`);
    onDelete(id);
  }

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Timestamp</th>
          <th>Type</th>
          <th>Dose</th>
          <th>User ID</th>
          <th></th>
        </tr>
      </thead>
      <tbody>
        {injections.map(injection => (
          <tr key={injection.id}>
            <td>{injection.id}</td>
            <td>{injection.timestamp}</td>
            <td>{injection.type}</td>
            <td>{injection.dose}</td>
            <td>{injection.user_id}</td>
            <td>
              <button
                type="button"
                onClick={() => handleDelete(injection.id)}
              >
                Delete
              </button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default InjectionList;
